import React from 'react'
import './Services.css'
import heartemoji from "../../img/heartemoji.png";
import humble from "../../img/humble.png";
import glasses from "../../img/glasses.png";


function Services() {
  return (
      <div className="services">

          {/* left */}
          <div className="awesome">
              <span>My Awesome</span>
              <span>Services</span>
              <spane>I'm a Self Taught, who enjoy building things that live on the internet.I develop static websites and web apps with front end and back end also. <br /> I aspire toward a career that will allow me to change my creativity through crafting beautiful software and engaging experiences</spane>

              <button className="button s-button">Download </button>
          </div>

          {/* right */}
          <div className="cards">

          </div>

      </div>
    )
}

export default Services
